  return (
    <>
    
    <formabc>
    <h1a>Student Registration</h1a>      
      <labelx>
        <b>Full Name</b>
        <input
          type="text"
          name= "name"
          value={student.name}
          onChange={handleInputs} required ="true"/>
      </labelx>
      <labelb>
        <b>Email</b>
        <input
          type="string"
          name="email"
          value={student.email}
          onChange={handleInputs} required ="true"
        />
        {/* {errors.email && <div className="error">{errors.email}</div>} */}
      </labelb>
      <labelb>
       <b>Password</b>
        <input
          type="string"
          name="password"
          value={student.password}
          onChange={handleInputs} required ="true"
        />
        {/* {errors.password && <div className="error">{errors.password}</div>} */}
      </labelb>
      <labelb>
        <b>Confirm Password</b>
        <input
          type="string"
          name="cpassword"
